import {
  BrowserRouter as Router,
  Switch,
  Route
} from "react-router-dom";
import CookieConsent from "react-cookie-consent";

import MediaPlayer from './components/MainComponents/MediaPlayer';
import Header from './components/MainComponents/Header';
import Login from './components/Dialogs/LoginForm';
import RegistrationForm from './components/Dialogs/RegistrationForm';

const App = () => {
  return (
    <main className="container">
      <Router>
        <div className="row justify-content-md-center">
          <Header />
        </div>
        <Switch>
          <div className="row justify-content-md-center">
            <Route path="/register">
              <RegistrationForm />
            </Route>
            <Route path="/login">
              <LoginForm />
            </Route>
            <MediaPlayer className="MediaPlayer" />
          </div>
        </Switch>
      </Router>
      <CookieConsent>This site uses cookies.</CookieConsent>
    </main >
  )
}

export default App;
